import React, {useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState()

  useEffect(() => {
    const callBackendAPI = async () => {
      const result = await axios(
        '/dolls'
      )
      console.log('running')
      setData(result.data)
    }
    console.log('running')
    callBackendAPI()
      .then(res => setData(res))
      .catch(err => console.log(err))
  })



  return (
    <div>
      lala
      {data}
    </div>
  );
}

export default App;
